import requests
import re
import os
import pandas as pd
from bs4 import BeautifulSoup

cleaner = re.compile('<.*?>')
result = []
def get_tweet(link):
    r = requests.get(url=link)

    html = r.content
    soup = BeautifulSoup(html, 'lxml')

    date = soup.find_all("span", class_="tweet-date")
    response = soup.find_all("div", class_="tweet-content media-body")
    for (res, dat) in zip(response, date):
        result.append([re.sub(cleaner, '', str(dat)), '', re.sub(cleaner, '', str(res))])
        print(dat)

